import React from "react";
import QuoteForm from "../quotes/QuoteForm";
import { useHistory } from "react-router-dom";

const NewQuote = () => {
  const history = useHistory();
  // history object that can be used to trigger some history changing action
  const addQuoteHandler = (quoteData) => {
    console.log(quoteData);

    // navigating programmatically to quotes page
    history.push("/quotes");
    // can also use replace which simply redirect to the page
    // push will create a new page and allow us to use back button of the chrome to go back
  };

  return <QuoteForm onAddQuote={addQuoteHandler}></QuoteForm>;
};

export default NewQuote;
